import React from "react";


const NavMenu = () =>{
  return(
    <div class="dropdown">
      <button class="dropbtn">Меню</button>
      <div class="dropdown-content">
        <a href="#">Профиль</a>
        <a href="#">Программа</a>
        <a href="#">Успеваемость</a>
        <a href="#">Заметки</a>
        <a href="#">Настройки</a>
        <a href="#">Выход</a>
      </div>
    </div>
  )
}


export const Header = () => {
  return(
    <header>
      <div>
        <a href="index.html">
        <img src="#" alt="Главная" class="w-4 h-4 mx-4"/>
        </a>
      </div>
      <nav>
        <NavMenu/>
      </nav>
    </header>
  )
}
